    let parsed_html = Html::parse_document(html_str);

    let div_selector = Selector::parse(r#"div[id="post-comic"]"#).unwrap();
    let img_selector = Selector::parse("img").unwrap();

    let div_element = parsed_html.select(&div_selector).next().unwrap();

    let mut urls = vec![];
    for img_element in div_element.select(&img_selector) {
        if let Some(src_value) = img_element.value().attr("src") {
            urls.push(src_value.to_string());
        }
    }

    for url in urls {
        println!("{}", url);
    }
